 href=\"https:\/\/ru.wikipedia.org\/wiki\/1879_%D0%B3%D0%BE%D0%B4\" title=\"1879 \u0433\u043e\u0434\">1879<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B5%D1%80%D0%BB%D0%B8%D0%BD\" title=\"\u0411\u0435\u0440\u043b\u0438\u043d\">\u0411\u0435\u0440\u043b\u0438\u043d\u0435<\/a> \u043e\u0442\u043a\u0440\u044b\u043b\u0430\u0441\u044c \u043f\u0435\u0440\u0432\u0430\u044f \u0432 \u043c\u0438\u0440\u0435 \u044d\u043b\u0435\u043a\u0442\u0440\u0438\u0447\u0435\u0441\u043a\u0430\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%96%D0%B5%D0%BB%D0%B5%D0%B7%D0%BD%D0%BE%D0%B4%D0%BE%D1%80%D0%BE%D0%B6%D0%BD%D1%8B%D0%B9_%D1%82%D1%80%D0%B0%D0%BD%D1%81%D0%BF%D0%BE%D1%80%D1%82\" title=\"\u0416\u0435\u043b\u0435\u0437\u043d\u043e\u0434\u043e\u0440\u043e\u0436\u043d\u044b\u0439 \u0442\u0440\u0430\u043d\u0441\u043f\u043e\u0440\u0442\">\u0436\u0435\u043b\u0435\u0437\u043d\u0430\u044f \u0434\u043e\u0440\u043e\u0433\u0430<\/a> \u0438 \u043f\u0440\u043e\u0434\u0435\u043c\u043e\u043d\u0441\u0442\u0440\u0438\u0440\u043e\u0432\u0430\u043d \u043f\u0435\u0440\u0432\u044b\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AD%D0%BB%D0%B5%D0%BA%D1%82%D1%80%D0%BE%D0%BF%D0%BE%D0%B5%D0%B7%D0%B4\" title=\"\u042d\u043b\u0435\u043a\u0442\u0440\u043e\u043f\u043e\u0435\u0437\u0434\">\u044d\u043b\u0435\u043a\u0442\u0440\u043e\u043f\u043e\u0435\u0437\u0434<\/a>, \u0441\u043a\u043e\u043d\u0441\u0442\u0440\u0443\u0438\u0440\u043e\u0432\u0430\u043d\u043d\u044b\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B8%D0%BC%D0%B5%D0%BD%D1%81,_%D0%92%D0%B5%D1%80%D0%BD%D0%B5%D1%80_%D1%84%D0%BE%D0%BD\" title=\"\u0421\u0438\u043c\u0435\u043d\u0441, \u0412\u0435\u0440\u043d\u0435\u0440 \u0444\u043e\u043d\">\u0412\u0435\u0440\u043d\u0435\u0440\u043e\u043c \u0444\u043e\u043d \u0421\u0438\u043c\u0435\u043d\u0441\u043e\u043c<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1884_%D0%B3%D0%BE%D0%B4\" title=\"1884 \u0433\u043e\u0434\">1884<\/a>&#160;\u2014 \u0430\u043c\u04