81%D0%BA%D0%B0%D1%8F_%D0%BC%D0%B0%D0%B3%D0%B8%D1%81%D1%82%D1%80%D0%B0%D0%BB%D1%8C\" title=\"\u0422\u0440\u0430\u043d\u0441\u0441\u0438\u0431\u0438\u0440\u0441\u043a\u0430\u044f \u043c\u0430\u0433\u0438\u0441\u0442\u0440\u0430\u043b\u044c\">\u0422\u0440\u0430\u043d\u0441\u0441\u0438\u0431\u0438\u0440\u0441\u043a\u0430\u044f \u043c\u0430\u0433\u0438\u0441\u0442\u0440\u0430\u043b\u044c<\/a>.<\/li><\/ul><h3>XX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1902_%D0%B3%D0%BE%D0%B4\" title=\"1902 \u0433\u043e\u0434\">1902<\/a>&#160;\u2014 \u041e\u043a\u043e\u043d\u0447\u0438\u043b\u0430\u0441\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D0%B3%D0%BB%D0%BE-%D0%B1%D1%83%D1%80%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0_(1899%E2%80%941902)\" title=\"\u0410\u043d\u0433\u043b\u043e-\u0431\u0443\u0440\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430 (1899\u20141902)\">\u0430\u043d\u0433\u043b\u043e-\u0431\u0443\u0440\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/1899_%D0%B3%D0%BE%D0%B4\" title=\"1899 \u0433\u043e\u0434\">1899<\/a>\u2014<a href=\"https:\/\/ru.wikipedia.org\/wiki\/1902_%D0%B3%D0%BE%D0%B4\" title=\"1902 \u0433\u043e\u0434\">1902<\/a> \u0433\u0433.).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1918_%D0%B3%D0%BE%D0%B4\" title=\"1918 \u0433\u043e\u0434\">1918<\/a><ul><li>\u041f\u043e\u0441\u043b\u0435 \u0440\u0430\u0441\u043f\u0430\u0434\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B2%D1%81%D1%82%D1%80%D0%BE-%D0%92%D0%B5%D0%BD%D0%B3%D1%80%D0%B8%D1%8F\" title=\"\u0410\u0432\u0441\u0442\u0440\u043e-\u0412\u0435\u043d\u0433\u0440\u0438\u044f\">\u0410\u0432\u0441\u0442\u0440\u043e-\u0412\u0435\u043d\u0433\u0440\u0438\u0438<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B8%D1%82%D1%82%D1%81%D0%B1%D1%83%D1%80%D0%B3\" title=\"\u041f\u0438\u0442\u0442\u0441\u0431\u0443\u0440\u0433\">\u041f\u0438\u0442\u0442\u0441\u0431\u0443\u0440\u0433\u0435<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B5%D0%B4%D0%B8%D0%BD%D1%91%D0%BD%D0%BD%D1%8B%D0%B5_%D0%A8%D1%82%D0%B0%D1%82%D1%8B_%D0%90%D0%BC%D0%B5%D1%80%D0%B8%D0%BA%D0%B8\" title=\"\u0421\u043e\u0435\u0434\u0438\u043d\u0451\u043d\u043d\u044b\u0435 \u0428\u0442\u0430\u0442\u044b \u0410\u043c\u0435\u0440\u0438\u043a\u0438\">\u0421\u0428\u0410<\/a>) \u043e\u0431\u044a\u044f\u0432\u043b\u0435\u043d\u043e \u043e \u043f\u043e\u043b\u0438\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u043c \u0441\u043e\u044e\u0437\u0435 \u0447\u0435\u0445\u043e\u0432 \u0438 \u0441\u043b\u043e\u0432\u0430\u043a\u043e\u0432, \u043a\u043e\u0442\u043e\u0440\u044b\u0439 \u043f\u0440\u0438\u0432\u0451\u043b \u043a \u043e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u043d\u0438\u044e \u0432 \u043e\u043a\u0442\u044f\u0431\u0440\u0435 \u0442\u043e\u0433\u043e \u0436\u0435 \u0433\u043e\u0434\u0430 \u043d\u0435\u0437\u0430\u0432\u0438\u0441\u0438\u043c\u043e\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A7%D0%B5%D1%85%D0%BE%D1%81%D0%BB%D0%BE%D0%B2%D0%B0%D0%BA%D0%B8%D1%8F\" title=\"\u0427\u0435\u0445\u043e\u0441\u043b\u043e\u0432\u0430\u043a\u0438\u044f\">\u0427\u0435\u0445\u043e\u0441\u043b\u043e\u0432\u0430\u0446\u043a\u043e\u0439 \u0440\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0438<\/a>.<\/li><li>\u041f\u043e\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u0438\u0435\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B0%D1%80%D0%BE%D0%B4%D0%BD%D1%8B%D0%B9_%D0%BA%D0%BE%D0%BC%D0%B8%D1%81%D1%81%D0%B0%D1%80%D0%B8%D0%B0%D1%82_%D0%BF%D1%80%D0%BE%D1%81%D0%B2%D0%B5%D1%89%D0%B5%D0%BD%D0%B8%D1%8F_%D0%A0%D0%A1%D0%A4%D0%A1%D0%A0\" title=\"\u041d\u0430\u0440\u043e\u0434\u043d\u044b\u0439 \u043a\u043e\u043c\u0438\u0441\u0441\u0430\u0440\u0438\u0430\u0442 \u043f\u0440\u043e\u0441\u0432\u0435\u0449\u0435\u043d\u0438\u044f \u0420\u0421\u0424\u0421\u0420\">\u041d\u0430\u0440\u043a\u043e\u043c\u043f\u0440\u043e\u0441\u0430<\/a> \u0432\u0432\u0435\u0434\u0435\u043d\u043e \u043e\u0431\u044f\u0437\u0430\u0442\u0435\u043b\u044c\u043d\u043e\u0435 \u0441\u043e\u0432\u043c\u0435\u0441\u0442\u043d\u043e\u0435 \u043e\u0431\u0443\u0447\u0435\u043d\u0438\u0435 \u0448\u043a\u043e\u043b\u044c\u043d\u0438\u043a\u043e\u0432 \u0438 \u0448\u043a\u043e\u043b\u044c\u043d\u0438\u0446.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1924_%D0%B3%D0%BE%D0%B4\" title=\"1924 \u0433\u043e\u0434\">1924<\/a><ul><li>\u041e\u0442\u043a\u0440\u044b\u0442\u0438\u0435 XIII \u0441\u044a\u0435\u0437\u0434\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BC%D0%BC%D1%83%D0%BD%D0%B8%D1%81%D1%82%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B0%D1%8F_%D0%BF%D0%B0%D1%80%D1%82%D0%B8%D1%8F_%D0%A1%D0%BE%D0%B2%D0%B5%D1%82%D1%81%D0%BA%D0%BE%D0%B3%D0%BE_%D0%A1%D0%BE%D1%8E%D0%B7%D0%B0\" title=\"\u041a\u043e\u043c\u043c\u0443\u043d\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u043f\u0430\u0440\u0442\u0438\u044f \u0421\u043e\u0432\u0435\u0442\u0441\u043a\u043e\u0433\u043e \u0421\u043e\u044e\u0437\u0430\">\u0420\u041a\u041f(\u0431)<\/a>.<\/li><li>\u0417\u0430\u043a\u043b\u044e\u0447\u0435\u043d\u043e \u00ab\u0421\u043e\u0433\u043b\u0430\u0448\u0435\u043d\u0438\u0435 \u043e\u0431 \u043e\u0431\u0449\u0438\u0445 \u043f\u0440\u0438\u043d\u0446\u0438\u043f\u0430\u0445 \u0434\u043b\u044f \u0443\u0440\u0435\u0433\u0443\u043b\u0438\u0440\u043e\u0432\u0430\u043d\u0438\u044f \u0432\u043e\u043f\u0440\u043e\u0441\u043e\u0432 \u043c\u0435\u0436\u0434\u0443 \u0421\u043e\u044e\u0437\u043e\u043c \u0421\u0421\u0420 \u0438 \u041a\u0438\u0442\u0430\u0439\u0441\u043a\u043e\u0439 \u0440\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u043e\u0439\u00bb. \u041c\u0435\u0436\u0434\u0443 \u0441\u0442\u0440\u0430\u043d\u0430\u043c\u0438 \u0443\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u044b \u043d\u043e\u0440\u043c\u0430\u043b\u044c\u043d\u044b\u0435 \u0434\u0438\u043f\u043b\u043e\u043c\u0430\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u0435 \u043e\u0442\u043d\u043e\u0448\u0435\u043d\u0438\u044f, \u043b\u0438\u0448\u0435\u043d\u044b \u0441\u0438\u043b\u044b \u0437\u0430\u043a\u043b\u044e\u0447\u0451\u043d\u043d\u044b\u0435 \u0440\u0430\u043d\u0435\u0435 \u0446\u0430\u0440\u0441\u043a\u0438\u043c \u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e\u043c \u043d\u0435\u0441\u043f\u0440\u0430\u0432\u0435\u0434\u043b\u0438\u0432\u044b\u0435 \u0434\u043e\u0433\u043e\u0432\u043e\u0440\u044b \u0438 \u0441\u043e\u0433\u043b\u0430\u0448\u0435\u043d\u0438\u044f, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B8%D1%82%D0%B0%D0%B9%D1%81%D0%BA%D0%BE-%D0%92%D0%BE%D1%81%D1%82%D0%BE%D1%87%D0%BD%D0%B0%D1%8F_%D0%B6%D0%B5%D0%BB%D0%B5%D0%B7%D0%BD%D0%B0%D1%8F_%D0%B4%D0%BE%D1%80%D0%BE%D0%B3%D0%B0\" title=\"\u041a\u0438\u0442\u0430\u0439\u0441\u043a\u043e-\u0412\u043e\u0441\u0442\u043e\u0447\u043d\u0430\u044f \u0436\u0435\u043b\u0435\u0437\u043d\u0430\u044f \u0434\u043e\u0440\u043e\u0433\u0430\">\u041a\u0438\u0442\u0430\u0439\u0441\u043a\u043e-\u0412\u043e\u0441\u0442\u043e\u0447\u043d\u0430\u044f \u0436\u0435\u043b\u0435\u0437\u043d\u0430\u044f \u0434\u043e\u0440\u043e\u0433\u0430<\/a> \u043f\u0440\u0435\u043e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u043d\u0430 \u0432 \u0441\u043e\u0432\u043c\u0435\u0441\u0442\u043d\u043e\u0435 \u043a\u043e\u043c\u043c\u0435\u0440\u0447\u0435\u0441\u043a\u043e\u0435 \u043f\u0440\u0435\u0434\u043f\u0440\u0438\u044f\u0442\u0438\u0435 \u0441 \u043f\u043e\u0441\u043b\u0435\u0434\u0443\u044e\u0449\u0435\u0439 \u043f\u0435\u0440\u0435\u0434\u0430\u0447\u0435\u0439 \u041a\u0438\u0442\u0430\u044e. \u042d\u0442\u043e \u043f\u0435\u0440\u0432\u044b\u0439 \u0440\u0430\u0432\u043d\u043e\u043f\u0440\u0430\u0432\u043d\u044b\u0439 \u0434\u043e\u0433\u043e\u0432\u043e\u0440 \u041a\u0438\u0442\u0430\u044f \u0441 \u0435\u0432\u0440\u043e\u043f\u0435\u0439\u0441\u043a\u043e\u0439 \u0441\u0442\u0440\u0430\u043d\u043e\u0439. \u0418\u043d\u0438\u0446\u0438\u0430\u0442\